Our foyer design for our #sntrideltatraditional project at @mizzou is all about unforgettable first impressions. 😍 From the black & white checkered floors to the textured grasscloth wall coverings, we’re bringing color & class into this high traffic area in a pulled back, edited way. Head to the blog for a closer look at our progress this far and stay tuned as we begin our final install next week! 🙌 
